import { Component } from "react";
import React from "react";
import { PageMain,SimpleGrid } from "core";
import NotificationSystem from "react-notification-system";
import Constants from '../../utils/constants';

export default class ReceiveCTRListPage extends Component
{
    constructor(props)
    {
        super(props);

        this.state = { isLoading: false };

        this.notificationSystem = React.createRef();

        this.identifierCode = this.props.match.params.identifierCode;
    }

    // Events.
    Backward(e)
    {
        e.preventDefault();
        history.back();
    }

    render()
    {
        return (
            <>
                <PageMain context={ this } title="دریافت CTR" icon="list-search" isLoading={ this.state.isLoading } footerLinks={[{ href: "/", text: "صفحه اصلی" }]} topButtons={[]}>
                    <div className="card">
                        <div className="card-body">
                            <SimpleGrid context={ this } dataKey="nationalNumber" minHeightTableWrapper={ Constants.MinGridHeight } hasSearchBox={ false } hideExportButton
                            filterBgColor="primary" name="crdsusList" title="جزئیات دریافت CTR" notificationSystem={ this.notificationSystem } enableAutoFetch
                            listApiUrl="/api/amls/bi/Receive_CTR/SearchReceive_CTR" extraItemsSentToFetchData={{ IdentifierCode: this.identifierCode }}
                            headers={[
                                //{ title: "شناسه", name: "id" },
                                { title: "نام بانک", name: "bankName" },
                                { title: "نام شعبه افتتاح  کننده", name: "openingBranchName" },
                                { title: "کد شعبه افتتاح کننده", name: "openingBranchCode" },
                                { title: "نام استان شعبه", name: "branchProvinceName" },
                                { title: "نام شهر شعبه", name: "branchCityName" },
                                { title: "تاریخ ترکنش", name: "transactionDate" },
                                { title: "نام صاحب حساب", name: "ownerAccountFirstName" },
                                { title: "نام خانوادگی صاحب حساب", name: "ownerAccountLastName" },
                                { title: "کد ملی صاحب حساب", name: "ownerAccountNationalCode" },
                                { title: "نام پدر صاحب حساب", name: "ownerAccountFatherName" },
                                { title: "نوع تراکنش", name: "transactionType" },
                                { title: "نوع وجه", name: "currentType" },
                                { title: "نوع حساب", name: "accountType" },
                                { title: "شماره حساب", name: "accountNumber" },
                                { title: "نام بانک طرف حساب", name: "transactionBankName" },
                                { title: "مبلغ", name: "amount" },
                                { title: "ارز", name: "currency" },
                                { title: "تاریخ چک", name: "checkDate" },
                                { title: "سری چک", name: "checkSeries" },
                                { title: "شماره سریال چک", name: "checkSerialNumber" },
                                { title: "نوع چک", name: "checkType" },
                                { title: "نام بانک چک", name: "checkBankName" },
                                { title: "نام شعبه چک", name: "checkBranchName" },
                                { title: "کد شعبه چک", name: "checkBranchCode" },
                                { title: "شماره حساب جاری", name: "currentAccountNumber" },
                                { title: "نام چک", name: "checkName" },
                                { title: "مبلغ چک", name: "checkAmount" },
                                { title: "نوع ارز چک", name: "checkCurrencyType" },
                                { title: "پرداخت کننده چک", name: "checkPayer" },
                                { title: "امضا کننده چک", name: "checkSigner" },
                                { title: "گیرنده چک", name: "checkBuyer" },
                                { title: "نام", name: "firstName" },
                                { title: "نام خانوادگی", name: "lastName" },
                                { title: "نام پدر", name: "fatherName" },
                                { title: "شناسه ملی", name: "nationalCode" },
                                { title: "شمار شناسنامه", name: "birthCertificateNumber" },
                                { title: "تاریخ تولد", name: "birthDate" },
                                { title: "استان", name: "provinceName" },
                                { title: "شهر", name: "cityName" },
                                { title: "آدرس", name: "address" },
                                { title: "کد پستی", name: "postalCode" },
                                { title: "تلفن", name: "telephoneNumber" },
                                { title: "موبایل", name: "cellphoneNumber" },
                                { title: "شغل", name: "jobName" },
                                { title: "آدرس محل کار", name: "jobAddress" },
                                { title: "کد پستی محل کار", name: "jobPostalCode" },
                                { title: "تلفن محل کار", name: "jobTelephoneNumber" },
                                { title: "توضیحات", name: "describtion" },
                                { title: "CTR شماره سریال فرم", name: "ctR_Number" },
                                { title: "کد ترکنش", name: "transactionCode" },
                                { title: "شناسه بانک", name: "bankId" },
                                { title: "کد پرسنلی", name: "personCode" },
                                { title: "نوع فرم", name: "formType" },
                                { title: "کد پولشویی", name: "moneyLaunderingCode" }
                            ]}
                            // filterOptions={[
                            //         { type: 'text', name: 'customerNumber', title: 'شماره مشتری' },
                            //         { type: 'text', name: 'nationalNumber', title: 'کد ملی/ شناسه ملی/کد فراگیر اتباع' }
                            // ]}
                            />
                        </div>
                        <div className="card-footer">
                            <div className="d-flex">
                                <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => this.Backward(e) } href="/" title="بازگشت به صفحه قبل">
                                    بازگشت
                                <i className="ti ti-arrow-left ms-1"></i>
                                </a>
                            </div>
                        </div>
                    </div>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
